import React from 'react';
import {Row,Col} from 'react-bootstrap'
import carBack from '../images/carBack.jpg'
const Presentation = () => {
    return (
        <div>
          <Row>
              <Col sm={8}>
                    <h1>Presentation</h1> 
              </Col>
              <Col sm={4} className="myImages">
                 <img src={carBack} className="carBack"/>
              </Col>
          </Row>
        </div>
    );
};

export default Presentation;
